var React = require('react');
var hljs = require('highlight.js/lib/highlight.js');
hljs.registerLanguage("x86asm", require("highlight.js/lib/languages/x86asm.js"));

module.exports = React.createClass({
  displayName: 'HighLight-' + "x86asm",
  render: function () {
    var children = this.props.children
    if (typeof children !== 'string') children = React.Children.only(children)
    return React.createElement('pre', { className: 'hljs ' + "x86asm" },
      React.createElement('code', {
        className: 'hljs ' + "x86asm",
        dangerouslySetInnerHTML: {
          __html: hljs.highlight("x86asm", children, true).value
        }
      })
    );
  }
});
